chapter2/Ex2_10.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract Ex2_10 {

    string[] public array = ["apple", "banana", "coconut", "durian", "etrog"];

    function search(string memory _key) public view returns(uint, string memory) {
        for(uint index = 0; index < array.length; index++) {
            if(keccak256(bytes(array[index])) == keccak256(bytes(_key))) {
                return (index, array[index]);
            }
        }
    }

}

